from dbraw import RawDataIOBasedef test_media():    rawio = RawDataIOBase()    mediaCollection = {}    shuffleData = {}        mediaTypeName = "Album"    artistID = '12345'    albumID = '56789'    name = "My Album"    pdbid = "-".join([mediaTypeName, f"Art{artistID}", f"Alb{albumID}"])    mediaRootData = rawio.makeRawMediaRootData(pdbid=pdbid, dbid=albumID, name=name)        artist = "My Artist"    artids = [artistID]    url = "http://www.myurl.com"    year = "1979"    mediaDeepData = rawio.makeRawMediaDeepData(pdbid=pdbid, dbid=albumID, artids=artids,                                               name=name, artist=artist, url=url,                                               group=mediaTypeName, year=year)                if mediaCollection.get(mediaTypeName) is None:        mediaCollection[mediaTypeName] = []    mediaCollection[mediaTypeName].append(mediaRootData)    shuffleData[pdbid] = mediaDeepData                mediaData = rawio.makeRawMediaCollectionData()    for mediaTypeName, mediaTypeData in mediaCollection.items():        mediaData.add(mediaTypeName, mediaTypeData)                if __name__ == "__main__":    test_media()